import react from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import { Form } from "react-bootstrap";
import React from "react";
import Header from "./Header";
const SearchCheck = styled.div`
  width: 100%;
  height: 100px;
  display: flex;
  flex-direction: row;
  align-items: center;
`;
function Home() {
  return (
    <div>
      <Header />
      <SearchCheck>
        <Form>
          <input placeholder="검색창" type="text" />
          <button>검색</button>
          {["radio"].map((type) => (
            <div key={`inline-${type}`} className="mb-3">
              <Form.Check
                inline
                label="작성자"
                name="group1"
                type={type}
                id={`1`}
              />
              <Form.Check
                inline
                label="일반텍스트"
                name="group2"
                type={type}
                id={`2`}
              />
              <Form.Check inline label="Hashtag" type={type} id={`3`} />
            </div>
          ))}
        </Form>
      </SearchCheck>
    </div>
  );
}

export default Home;
